import React, { Component } from "react";

export default class Navbar extends Component {
  render() {
    return (
      <div>
        <nav className="navbar">
          <div className="navbar-menu">
            <div className="navbar-start">
              <a className="navbar-item">Heihei</a>
            </div>
          </div>
        </nav>
      </div>
    );
  }
}
